insert  into `db_gallery`(`id`,`gallery_id`,`lang_id`,`name`,`description`,`preview_count`,`block_status`,`readonly`,`create_date`,`create_user`,`update_date`,`update_user`) values (17,1,2,'Sporta sacensības','tas ir teksta salikums, kuru izmanto poligrāfijā un maketēšanas darbos. Lorem Ipsum ir kļuvis par vispārpieņemtu teksta aizvietotāju kopš 16. gadsimta sākuma. Tajā laikā kāds nezināms iespiedējs izveidoja teksta fragmentu, lai nodrukātu grāmatu ar burtu paraugiem. Tas ir ne tikai pārdzīvojis piecus gadsimtus, bet bez ievērojamām izmaiņām saglabājies arī mūsdienās, pārejot uz datorizētu teksta apstrādi. Tā popularizēšanai 60-tajos gados kalpoja Letraset burtu paraugu publicēšana ar Lorem Ipsum teksta fragmentiem un, nesenā pagātnē, tādas maketēšanas programmas kā Aldus PageMaker, kuras šablonu paraugos ir izmantots Lorem Ipsum teksts.',0,0,0,'2012-01-03 14:32:48','abc','2012-01-09 13:53:29','abc'),(18,1,1,'Виды спорта','[space][space][space]Давно выяснено, что при оценке дизайна и композиции читаемый текст мешает сосредоточиться. Lorem Ipsum используют потому, что тот обеспечивает более или менее стандартное заполнение шаблона, [n][space][space][space]а также реальное распределение букв и пробелов в абзацах, которое не получается при простой дубликации &quot;Здесь ваш текст.. Здесь ваш текст.. Здесь ваш текст..&quot; [n][space][space][space]Многие программы электронной вёрстки и редакторы HTML используют Lorem Ipsum в качестве текста по умолчанию, так что поиск по ключевым словам &quot;lorem ipsum&quot; сразу показывает, как много веб-страниц всё ещё дожидаются своего настоящего рождения. За прошедшие годы текст Lorem Ipsum получил много версий. Некоторые версии появились по ошибке, некоторые - намеренно (например, юмористические варианты).',0,0,0,'2012-01-03 14:32:48','abc','2012-01-09 13:53:29','abc'),(19,2,2,'Slides','Following gallery is used for image rotation on the main page. Gallery is blocked to preserve its usage as a normal gallery',0,1,1,'2012-01-03 15:20:47','abc','2012-01-27 17:26:42','1Bm'),(20,2,1,'Слайды','Данные изображения используются в ротации на главной странице. Все галлерея заблокирована и закрыта для выбора, как обычная галлерея',0,1,1,'2012-01-03 15:20:47','abc','2012-01-27 17:26:42','1Bm'),(21,3,2,'Dažādas bildes','[space][space][space]Bez tam visi internetā esošie Lorem Ipsum ģeneratori, pārsvarā izmanto vienu un to pašu teksta fragmentu, kas tiek atkārtots, lai iegūtu vajadzīgo teksta daudzumu.',0,0,0,'2012-01-04 10:24:05','abc','2012-01-09 13:08:45','abc'),(22,3,1,'Разные картинки','[space][space][space]Давно выяснено, что при оценке дизайна и композиции читаемый текст мешает сосредоточиться. [n][space][space][space]Lorem Ipsum используют потому, что тот обеспечивает более или менее стандартное заполнение шаблона, а также реальное распределение букв и пробелов в абзацах, которое не получается при простой дубликации &quot;Здесь ваш текст.. Здесь ваш текст..',0,0,0,'2012-01-04 10:24:05','abc','2012-01-09 13:08:45','abc'),(25,4,2,'Exercise #1','',8,0,0,'2012-01-08 16:19:51','abc','2012-01-09 01:07:53','abc'),(26,4,1,'Упражнение №1','',8,0,0,'2012-01-08 16:19:51','abc','2012-01-09 01:07:53','abc'),(27,5,2,'Abstract','',5,0,1,'2012-01-08 23:29:46','abc','2012-01-08 23:58:01','abc'),(28,5,1,'Абстракционные','',5,0,1,'2012-01-08 23:29:46','abc','2012-01-08 23:58:01','abc'),(29,6,2,'abc','',0,0,0,'2012-01-27 17:09:35','1Bm','2012-01-27 17:10:48','1Bm'),(30,6,1,'abc','',0,0,0,'2012-01-27 17:09:35','1Bm','2012-01-27 17:10:48','1Bm');

