/*Table structure for table `db_layout` */

DROP TABLE IF EXISTS `db_layout`;

CREATE TABLE `db_layout` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `lang_id` int(3) unsigned DEFAULT NULL,
  `position` char(10) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  `nr` int(3) unsigned DEFAULT NULL,
  `module_type` char(20) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  `module_id` int(10) unsigned DEFAULT NULL,
  `module_text` char(200) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=182 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

/*Data for the table `db_layout` */

