/*Table structure for table `db_log_online` */

DROP TABLE IF EXISTS `db_log_online`;

CREATE TABLE `db_log_online` (
  `id` int(15) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` char(3) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `url` char(200) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `IP` char(15) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `time` datetime DEFAULT NULL,
  `start_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  PRIMARY KEY (`id`)
