/*Table structure for table `db_news` */

DROP TABLE IF EXISTS `db_news`;

CREATE TABLE `db_news` (
  `id` int(5) unsigned NOT NULL AUTO_INCREMENT,
  `news_id` int(5) unsigned NOT NULL,
  `lang_id` int(3) unsigned NOT NULL,
  `date` date DEFAULT NULL,
  `title` char(200) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  `description` text CHARACTER SET utf8 COLLATE utf8_unicode_ci,
  `text` text CHARACTER SET utf8 COLLATE utf8_unicode_ci,
  `show_galleries` char(10) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  `block_status` int(1) NOT NULL DEFAULT '0',
  `create_date` datetime NOT NULL,
  `create_user` char(3) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `update_date` datetime DEFAULT NULL,
  `update_user` char(3) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8;

