insert  into `db_offers`(`id`,`offer_id`,`lang_id`,`nr`,`date`,`title`,`description`,`text`,`block_status`,`readonly`,`position`,`create_date`,`create_user`,`update_date`,`update_user`) values (1,1,2,0,'0000-00-00 00:00:00','Studija „PIYONA” piedāvā iziet procedūru kursu figūras korekcijai!','[space][space][space]Studija „PIYONA” piedāvā pirms Jaungada balles iziet procedūru kursu figūras korekcijai![n][n][space][space][space]Pressoterapija - atjaunoša terapijas metode.[n][space][space][space][n][space][space][space]Anticelulīta šorti un limfodrenāžas zābaki.','<p>\r\n	<span style=\"color: rgb(0, 0, 0); font-family: verdana; font-size: 11px;\">&nbsp;&nbsp; Laba pa&scaron;sajūta atkarīga no organisma galveno sistēmu darbības, īpa&scaron;i no limfātiskās sistēmas, kura līdzīgi asinsrites sistēmai, caurvij visus audus. Cilvēka limfa pildīta ar &scaron;ūnu darbības atkritumiem, tā satur baktērijas un toksīnus. Tāpēc ir svarīgi, lai limfa būtu nevis pasīva, bet aktīvi darbotos.<br />\r\n	<br />\r\n	&nbsp;&nbsp; Tie&scaron;i anticelulīta &scaron;ortu procedūra palīdz attīrīt organisma limfātisko sistēmu un uzlabot tās darbību, kā arī tikt vaļā no nevēlamā celulīta.<br />\r\n	<br />\r\n	&nbsp;&nbsp; Anticelulīta &scaron;ortu procedūra efektīvi izvada no organisma lieko &scaron;ķidrumu un kaitīgās vielas, atjauno ūdens balansu, kas paātrina limfu cirkulāciju un normalizē starp&scaron;ūnu &scaron;ķidruma daudzumu. Tas uzlabo vēnu asinsriti, kā arī aktivizē vielmaiņu procesu &scaron;ūnās un tauku &scaron;ūnās. Procedūras laikā tiek stimulēta un uzlabojas kuņģa zarnu trakta darbība. Ar anticelulīta &scaron;ortu palīdzību tiek nostiprinātas vēdera sieniņas. Procedūra ļauj novērst dažādus ādas pigmentācijas procesus, ievērojami samazināt ķermeņa apjomu, efektīvi cīnīties ar celulītu un aptauko&scaron;anos, padarot ādu gludu un elastīgu.<br />\r\n	<br />\r\n	&nbsp;&nbsp; Anticelulīta &scaron;ortu procedūra mazina nogurumu, stresu, veicina muskuļu atslābinā&scaron;anos, stiprina saistaudus utt.<br />\r\n	<br />\r\n	&nbsp;&nbsp; Profilaktiski ieteicama cilvēkiem ar mazkustīgu dzīvesveidu, jo savā ziņā &scaron;i procedūra ir pasīvs sporta veids.<br />\r\n	<br />\r\n	&nbsp;&nbsp; Arī grūtnieces var apmeklēt procedūras, vienīgi tādos gadījumos tiek masēti tikai aug&scaron;stilbi.<br />\r\n	<br />\r\n	&nbsp;&nbsp; Procedūra ieteicama: limfas cirkulācijas traucējumiem, tūskas, varikozām vēnām un hroniskas venozās mazspējas, muskuļu pārslodzes, ādas tonusa un elastības uzlabo&scaron;anai, celulīta un aptauko&scaron;anās mazinā&scaron;anai.<br />\r\n	<br />\r\n	&nbsp;&nbsp; Procedūras rezultāts: striju un celulīta samazinā&scaron;anās, svara zudums un samazinājums taukaudos, ādas izlīdzinā&scaron;ana, ādas elastības uzlabo&scaron;ana un nostiprinā&scaron;ana, detoksikācija &ndash; dziļā ādas attīrī&scaron;ana.<br />\r\n	<br />\r\n	&nbsp;&nbsp; Kontrindikācijas: dziļa asinsvadu tromboze, infekcijas (iekaisumi, limfangīts), smags endartrīts un artrīts (3 un 4 stadija), sirdsnepietiekamība, hemofilija, paaugstināta kapilāru sieniņas jutība.<br />\r\n	<br />\r\n	&nbsp;&nbsp; Procedūras ilgums &ndash; 30 minūtes.</span></p>\r\n',0,1,'left,right,top','2011-12-21 14:09:50','abc','2012-01-09 13:51:58','abc'),(2,1,1,0,'0000-00-00 00:00:00','[space][space][space]Студия &quot;PIYONA&quot; предлагает пройти курс лечения для[space][space]коррекции фигуры!','[space][space][space]Студия &quot;PIYONA&quot; предлагает Вам перед новогодним балом пройти курс лечения для[space][space]коррекции фигуры![n][n][space][space][space]Прессотерапия - уникальная по своей эффективности и принципу действия процедура лечения целлюлита.[n][n][space][space][space]Антицеллюлитные шорты и лимфодренажные сапоги.','<p>\r\n	<span style=\"color: rgb(0, 0, 0); font-family: verdana; font-size: 11px;\">&nbsp;&nbsp; Хорошее самочувствие зависит от работы основных систем организма, особенно от лимфатической системы, которая похожа на систему кровообращения. Лимфа человека заполнена отбросами действия клеток и содержит бактерии и токсины. Поэтому очень важно, чтобы лимфа не была пассивной, а активно работала.<br />\r\n	<br />\r\n	&nbsp;&nbsp; Непосредственно процедура антицеллюлитных шортов помогает очищать лимфатическую систему организма и улучшать её работу.<br />\r\n	<br />\r\n	&nbsp;&nbsp; Процедура, выводя из организма лишнюю жидкость и вредные вещества, восстанавливает водный баланс, который ускоряет циркуляцию лимфы и нормализует количество межклеточной жидкости. Процедура улучшает венозное кровообращение, а также активизирует процесс обмена веществ в клетках и в жировых клетках. Во время процедуры стимулируется и улучшается действие желудочно-кишечного тракта. С помощью процедуры укрепляются стенки живота. Антицеллюлитные шорты позволяют предотвращать всевозможные процессы пигментации кожи, значительно уменьшить объем тела, эффективно бороться с целлюлитом и ожирением, делая кожу гладкой и упругой.<br />\r\n	<br />\r\n	&nbsp;&nbsp; Антицеллюлитные шорты снимают усталость, стресс, способствует расслаблению мышц, укрепляет соединительную ткань&nbsp;и т.д.<br />\r\n	<br />\r\n	&nbsp;&nbsp; Антицеллюлитные шорты как профилактика рекомендуется для людей с малоподвижным образом жизни, тат как по своему образу процедура является пассивным видом спорта.<br />\r\n	<br />\r\n	&nbsp;&nbsp; Кроме того и беременные женщины могут посещать процедуры, им будут &nbsp;массировать бедра.<br />\r\n	<br />\r\n	&nbsp;&nbsp; Процедура рекомендуется: при циркуляционных нарушениях лимфы, при отёках, при варикозном расширении вен и хронической венозной недостаточности, при перегрузках мышц, для улучшения тонуса и эластичности кожи, при целлюлите и ожирении.<br />\r\n	<br />\r\n	&nbsp;&nbsp; Результат процедуры: уменьшение растяжек и целлюлита, потеря веса и уменьшение жировых отложений, выравнивание кожи, повышение и укрепление упругости кожи, детоксикация &ndash; глубокая очистка кожи.<br />\r\n	<br />\r\n	&nbsp;&nbsp; Противопоказания: глубокий тромбоз кровеносных сосудов, инфекции (воспаления, лимфангит), тяжёлые артриты и эндартерииты (3 и 4 стадия), сердечная недостаточность, гемофилия, повышенная чувствительность стенок капилляров.<br />\r\n	<br />\r\n	&nbsp;&nbsp; Длительность процедуры &ndash; 30 минут.</span></p>\r\n',0,1,'left,right,top','2011-12-21 14:09:50','abc','2012-01-09 13:51:58','abc');

