insert  into `db_sections`(`id`,`sub_id`,`lang_id`,`title`,`text`,`show_galleries`,`preview_text`,`first_page`,`params`,`create_date`,`create_user`,`update_date`,`update_user`) values (15,132,0,'Перевозка грузов','','0',NULL,0,NULL,'2009-01-17 18:01:36','abc','2011-11-21 16:00:28','abc'),(16,132,3,'About en','<p>\r\n	text en 1</p>\r\n','0',NULL,0,NULL,'2011-11-22 14:59:03','abc','2011-11-23 11:37:43','abc'),(17,132,2,'Par mums','<p style=\"text-align: justify\">\r\n	<span style=\"font-family: verdana; font-size: 11px\">&nbsp;&nbsp; Studija PIYONA aicina visus &nbsp;uz nodarbībām - &nbsp;Pilates , HATHA Yoga , Pi-Yo , Fit-ball, Ballet , ķermeņa atveseļo&scaron;anai. Jūs gaida mierīga un maiga atmosfēra. Mēs strādājam mazās grupās, ar individuālo pieeju katram klientam.<br />\r\n	Nodarbību slodze ir paredzēta jebkuram vecumam.<br />\r\n	<br />\r\n	&nbsp;&nbsp;&nbsp;Pilates un Yogas nodarbību tehnika attīstīs Jūsu spēku, kustību un locītavu lokanību. Speciāli vingrinājumi uzlabos elpo&scaron;anu, koncentrē&scaron;anās spējas, emocionālo noskaņojumu, palīdzēs cīnīties ar stresu un hroniskā noguruma sindromu.&nbsp;<br />\r\n	<br />\r\n	&nbsp;&nbsp; Nodarbībās ir vajadzīga koncentrē&scaron;anās, jāiemācās domāt tikai par sevi, par savu ķermeni kā par ļoti mīļu un aprūpējamu lietu.<br />\r\n	<br />\r\n	&nbsp;&nbsp; Vingro&scaron;anas laikā nepiecie&scaron;ama pārdomāta, ar katru kustību saskaņota ieelpa un izelpa. Tikai tad būs sasniegts atveseļojo&scaron;s efekts.<br />\r\n	<br />\r\n	&nbsp;&nbsp; Nodarbības īpa&scaron;i piemērotas tiem cilvēkiem, kas cie&scaron; no sāpēm mugurkaula rajonā, kas garas stundas pavada pie datora, sakarā ar ko sāp kakla daļa un kam ir regulāras sāpes jostas vietā.<br />\r\n	<br />\r\n	&nbsp;&nbsp; Nodarbības laika Jūs uzreiz jutīsiet, kā muskuļi, kuri balsta mugurkaulu, kļūst silti.<br />\r\n	<br />\r\n	<strong>Ļaužu grupas, kurām varam ieteikt &scaron;īs nodarbības:</strong></span></p>\r\n<ul style=\"margin-left: 40px\">\r\n	<li style=\"text-align: justify\">\r\n		<span style=\"font-family: verdana; font-size: 11px\">strādājo&scaron;ie, biznesmeņi, cilvēki, kuri pakļauti stresam;</span></li>\r\n	<li style=\"text-align: justify\">\r\n		<span style=\"font-family: verdana; font-size: 11px\">vecāka gada gājuma cilvēki, kuri nevar lēkāt, tikt galā ar smagu fizisku slodzi;</span></li>\r\n	<li style=\"text-align: justify\">\r\n		<span style=\"font-family: verdana; font-size: 11px\">pusaudži, kuri mācību procesa gaitā daudz laika pavada sēžot aiz rakstāmgalda, radot priek&scaron;noteikumus skoliozei un mugurkaula deformācijām;</span></li>\r\n	<li style=\"text-align: justify\">\r\n		<span style=\"font-family: verdana; font-size: 11px\">cilvēki, kuriem nepiecie&scaron;ama mugurkaula korekcija;</span></li>\r\n	<li style=\"text-align: justify\">\r\n		<span style=\"font-family: verdana; font-size: 11px\">jūtīgi, emocionāli cilvēki, kuriem nepiecie&scaron;ams atbrīvoties no stresa;</span></li>\r\n	<li style=\"text-align: justify\">\r\n		<span style=\"font-family: verdana; font-size: 11px\">sievietes, kuras gaida bērniņu vai nesen dzemdēju&scaron;as;</span></li>\r\n	<li style=\"text-align: justify\">\r\n		<span style=\"font-family: verdana; font-size: 11px\">cilvēki ar palielinātu svaru, kuri nespēj izturēt citas nodarbības ar lielu slodzi.</span></li>\r\n</ul>\r\n<p style=\"text-align: justify\">\r\n	&nbsp;</p>\r\n<p style=\"text-align: justify\">\r\n	<span style=\"font-family: verdana; font-size: 11px\"><strong>Pateicoties mūsu nodarbībām Jūs:</strong></span></p>\r\n<ul style=\"margin-left: 40px\">\r\n	<li style=\"text-align: justify\">\r\n		<span style=\"font-family: verdana; font-size: 11px\">izkopsiet stāju;</span></li>\r\n	<li style=\"text-align: justify\">\r\n		<span style=\"font-family: verdana; font-size: 11px\">attīstīsiet muskulatūru;</span></li>\r\n	<li style=\"text-align: justify\">\r\n		<span style=\"font-family: verdana; font-size: 11px\">ietrenēsiet līdzsvara sajūtu;</span></li>\r\n	<li style=\"text-align: justify\">\r\n		<span style=\"font-family: verdana; font-size: 11px\">atslogosiet mugurkaulu;</span></li>\r\n	<li style=\"text-align: justify\">\r\n		<span style=\"font-family: verdana; font-size: 11px\">nomierināsiet un relaksēsies prātu;</span></li>\r\n	<li style=\"text-align: justify\">\r\n		<span style=\"font-family: verdana; font-size: 11px\">neko neizmežģīsiet vai nesastiepsiet.</span></li>\r\n</ul>\r\n<p style=\"text-align: justify\">\r\n	<br />\r\n	<span style=\"font-family: verdana; font-size: 11px\"><strong>&Scaron;is nodarbības paātrinās rehabilitāciju pēc traumām un operācijām.</strong><br />\r\n	<br />\r\n	<strong>Nodarbojoties regulāri, Jūs sasniegsiet tikai labus rezultātus un pozitīvas emocijas.</strong><br />\r\n	<br />\r\n	<strong>Mēs Jums palīdzēsim kļūt veselīgākiem!</strong></span></p>\r\n','','<p style=\"text-align: justify\">\n	<span style=\"font-family: verdana; font-size: 11px\">&nbsp;&nbsp; Studija PIYONA aicina visus &nbsp;uz nodarbībām - &nbsp;Pilates , HATHA Yoga , Pi-Yo , Fit-ball, Ballet , ķermeņa atveseļo&scaron;anai. Jūs gaida mierīga un maiga atmosfēra. Mēs strādājam mazās grupās, ar individuālo pieeju katram klientam.<br />\n	Nodarbību slodze ir paredzēta jebkuram vecumam.<br />\n	<br />\n	&nbsp;&nbsp;&nbsp;Pilates un Yogas nodarbību tehnika attīstīs Jūsu spēku, kustību un locītavu lokanību. Speciāli vingrinājumi uzlabos elpo&scaron;anu, koncentrē&scaron;anās spējas, emocionālo noskaņojumu, palīdzēs cīnīties ar stresu un hroniskā noguruma sindromu.&nbsp;</span></p>',1,'show_preview**1::show_title**1','2011-11-22 14:59:03','abc','2012-01-27 17:35:36','1Bm'),(18,132,1,'О нас','<p style=\"text-align: justify\">\r\n	<span style=\"font-family: verdana; color: rgb(0,0,0); font-size: 12px\">&nbsp;&nbsp; Студия PIYONA приглашает всех желающих&nbsp; на занятия - &nbsp;Pilates ,&nbsp;&nbsp; Yoga , Pi-Yo , Fit-ball , Ballet, для здоровья и совершенствования своего тела. Вас ждёт спокойная и уютная атмосфера. Мы работаем в маленьких группах, с индивидуальным подходом для каждого клиента.<br />\r\n	<br />\r\n	&nbsp;&nbsp; Нагрузка занятий предусмотрена для любого возраста.<br />\r\n	<br />\r\n	&nbsp;&nbsp; Эта техника занятий Пилатеса и Йоги поможет развить Вашу силу, гибкость движений и суставов. Специальные упражнения улучшат дыхание, способность концентрации, эмоциональное настроение, помогут в борьбе со стрессом и синдромом хронической усталости.<br />\r\n	<br />\r\n	&nbsp;&nbsp; На занятиях нужна концентрация, нужно научиться думать только о себе, о своем теле как о очень милых и заботливых вещах.<br />\r\n	<br />\r\n	&nbsp;&nbsp; Во время упражнений необходим обдуманный, при каждом движении - согласованный вдох и выдох. Только тогда оздоровительный эффект будет достигнутым.<br />\r\n	<br />\r\n	&nbsp;&nbsp; Занятия приспособлены особенно для тех людей, которые страдают от болей в районе позвоночника, которые проводят долгое время у компьютера, в связи, с чем болит шейный отдел и для людей, имеющих регулярные боли в поясничной области.<br />\r\n	<br />\r\n	&nbsp;&nbsp; Во время занятий Вы сразу же &nbsp;почувствуете, как мышцы, поддерживающие позвоночник, становятся тёплыми.<br />\r\n	<br />\r\n	<strong>Группы людей, для которых мы советуем эти занятия:</strong></span></p>\r\n<ul style=\"margin-left: 40px\">\r\n	<li style=\"text-align: justify\">\r\n		<span style=\"font-family: verdana; color: rgb(0,0,0); font-size: 12px\">работающие, бизнесмены, люди, которые поддаются стрессу;</span></li>\r\n	<li style=\"text-align: justify\">\r\n		<span style=\"font-family: verdana; color: rgb(0,0,0); font-size: 12px\">пожилые люди, которые не могут прыгать и справиться с тяжелой физической нагрузкой;</span></li>\r\n	<li style=\"text-align: justify\">\r\n		<span style=\"font-family: verdana; color: rgb(0,0,0); font-size: 12px\">подростки, которые в результате учебного процесса много времени проводят сидя за письменным столом, создавая условия для сколиоза и деформации позвоночника;</span></li>\r\n	<li style=\"text-align: justify\">\r\n		<span style=\"font-family: verdana; color: rgb(0,0,0); font-size: 12px\">люди, для которых необходима коррекция позвоночника;</span></li>\r\n	<li style=\"text-align: justify\">\r\n		<span style=\"font-family: verdana; color: rgb(0,0,0); font-size: 12px\">чувствительные, эмоциональные люди, которым необходимо освободиться от стресса;</span></li>\r\n	<li style=\"text-align: justify\">\r\n		<span style=\"font-family: verdana; color: rgb(0,0,0); font-size: 12px\">беременные женщины или недавно родившие женщины;</span></li>\r\n	<li style=\"text-align: justify\">\r\n		<span style=\"font-family: verdana; color: rgb(0,0,0); font-size: 12px\">люди с избыточным весом, которые не могут выдержать другие занятия с большой нагрузкой.</span></li>\r\n</ul>\r\n<p style=\"text-align: justify\">\r\n	<br />\r\n	<span style=\"font-family: verdana; color: rgb(0,0,0); font-size: 12px\"><strong>Благодаря нашим занятиям Вы:</strong></span></p>\r\n<ul style=\"margin-left: 40px\">\r\n	<li style=\"text-align: justify\">\r\n		<span style=\"font-family: verdana; color: rgb(0,0,0); font-size: 12px\">выровните осанку;</span></li>\r\n	<li style=\"text-align: justify\">\r\n		<span style=\"font-family: verdana; color: rgb(0,0,0); font-size: 12px\">разовьёте мускулатуру;</span></li>\r\n	<li style=\"text-align: justify\">\r\n		<span style=\"font-family: verdana; color: rgb(0,0,0); font-size: 12px\">натренируете ощущение равновесия;</span></li>\r\n	<li style=\"text-align: justify\">\r\n		<span style=\"font-family: verdana; color: rgb(0,0,0); font-size: 12px\">разгрузите позвоночник;</span></li>\r\n	<li style=\"text-align: justify\">\r\n		<span style=\"font-family: verdana; color: rgb(0,0,0); font-size: 12px\">успокоите и релаксируете разум;</span></li>\r\n	<li style=\"text-align: justify\">\r\n		<span style=\"font-family: verdana; color: rgb(0,0,0); font-size: 12px\">ничего не вывихнете, и не растяните.</span></li>\r\n</ul>\r\n<p style=\"text-align: justify\">\r\n	&nbsp;</p>\r\n<p style=\"text-align: justify\">\r\n	<span style=\"font-family: verdana; color: rgb(0,0,0); font-size: 12px\"><strong>Эти занятия ускорят реабилитацию после травм и операций.</strong><br />\r\n	<br />\r\n	<strong>Занимаясь регулярно, Вы достигнете только хорошие результаты и положительные эмоции.</strong><br />\r\n	<br />\r\n	<strong>Мы Вам поможем стать здоровее!</strong></span></p>\r\n','','<p style=\"text-align: justify\">\n	<span style=\"font-family: verdana; color: rgb(0,0,0); font-size: 12px\">&nbsp;&nbsp; Студия PIYONA приглашает всех желающих&nbsp; на занятия - &nbsp;Pilates ,&nbsp;&nbsp; Yoga , Pi-Yo , Fit-ball , Ballet, для здоровья и совершенствования своего тела. Вас ждёт спокойная и уютная атмосфера. Мы работаем в маленьких группах, с индивидуальным подходом для каждого клиента.<br />\n	<br />\n	&nbsp;&nbsp; Нагрузка занятий предусмотрена для любого возраста.<br />\n	<br />\n	&nbsp;&nbsp; Эта техника занятий Пилатеса и Йоги поможет развить Вашу силу, гибкость движений и суставов. Специальные упражнения улучшат дыхание, способность концентрации, эмоциональное настроение, помогут в борьбе со стрессом и синдромом хронической усталости.<br />\n	<br />\n	&nbsp;&nbsp; На занятиях нужна концентрация, нужно научиться думать только о себе, о своем теле как о очень милых и заботливых вещах...</span></p>',1,'show_preview**1::show_title**1','2011-11-22 14:59:03','abc','2012-01-27 17:35:36','1Bm'),(19,138,2,'Nodarbības','<p style=\"text-align: justify\">\r\n	<span style=\"font-family: verdana; font-size: 11px\"><strong>PILATES </strong>- ir unikāla vingrojumu sistēma, kas ir vērsta uz stiep&scaron;anos un muskuļu&nbsp;tonizē&scaron;anu un&nbsp;nostiprinā&scaron;anu, kā arī&nbsp;stājas, lokanības un līdzsvara uzlabo&scaron;anu.Pilates attīsta koordināciju un iemāca kustēties skaisti.&nbsp;Nodarbības ar pilatēm ir noderīgas jebkura vecuma un dzimuma cilvēkiem, visiem, kuri vēlās labi izskatīties un būt vienmēr lieliskā formā. Dažādi vingrojumi prasa precīzu un vienmērīgu izpildi bez pauzēm. Tie ir ļoti dažādi un ietver darbībā vienlaicīgi lielu daudzumu muskuļu, prasot to tehniski pareizu izpildījumu, bet atkārtojumu daudzums var būt &scaron;ajā gadījumā minimāls. Kustības maigi izstiepj muskuļus, padarot tos garākus un slaidākus. Liels pluss &scaron;ajā darbā ir tāds, ka tiek iesaistītas ļoti dziļas muskuļu grupas, par kuru esamību Jūs pat neesat aizdomāju&scaron;ies, bet tie spēlē vienu no svarīgākajām lomām, veidojot skaistu figūru.<br />\r\n	<br />\r\n	<strong>HATHA JOGA</strong>&nbsp;- ir kas vairāk nekā vingro&scaron;ana, tā ir jaunība un skaistums. Tā ir iespēja atklāt spējas, par kurām cilvēks nav pats iedomājies. Caur elpo&scaron;anu, mūziku un atbrīvo&scaron;anos notiek dziļa relaksācija un sava ķermeņa skaistuma apzinā&scaron;anās. Jogas asanas &ndash; ir īpa&scaron;i vingrinājumi kur tiek izmantota maiga ķermeņa stiep&scaron;ana, grie&scaron;ana, spēka elementi lai atdzīvinātu katru ķermeņa muskuļi un locītavu. Atbrīvojot ķermeni &ndash; atbrīvojas prāts. Ķermenim kļūstot plastiskākam, prāts arī kļūst lokanāks, tas dara dzīvi vienkār&scaron;āku.<br />\r\n	<br />\r\n	<strong>FIT-BALL</strong>&nbsp;- nodarbības ar lielo vingro&scaron;anas bumbu izmanto&scaron;anu. Saudzējo&scaron;a slodze mugurkaulam un locītavām. Oriģināla horeogrāfija, viegla koordinācija, mērena slodze. Nodarbības visiem sagatavotības līmeņiem.<br />\r\n	<br />\r\n	<strong>YOGA PILATES</strong>&nbsp;- abu novirzienu sintēze - papildus pilates vingrinājumiem visam ķermenim muskulatūras nostiprinā&scaron;anai nodarbībā tiek integrētas jogas pamatpozas, elpo&scaron;ana, stiep&scaron;anās un relaksācijas vingrinājumi.<br />\r\n	<br />\r\n	<strong>BALETS -</strong> Skaista stāja un kustības, auguma izpratne, baleta grācija, &scaron;arms, elegance un stila izjūta, jaunības eliksīrs. Fantastisks ķermeņa formu uzlabo&scaron;anas veids.</span></p>\r\n','',NULL,0,NULL,'2011-12-21 11:31:49','abc','2012-01-30 12:58:40','abc'),(20,138,1,'Занятия','<p style=\"text-align: justify\">\r\n	<span style=\"font-family: verdana; font-size: 11px\"><strong>ПИЛАТЕС </strong>- это уникальная система упражнений на растяжку и укрепление мышц. Она направлена на укрепление и тонизирование мышц, улучшение осанки, гибкости и чувства равновесия.&nbsp;Пилатес развивает координацию и учит двигаться красиво и грациозно.&nbsp;Занятия пилатесом полезны людям любого возраста и пола, всем, кто хочет хорошо выглядеть и быть в отличной форме. Непохожие друг на друга упражнения требуют точного плавного без пауз выполнения. Упражнения очень разнообразны и включают в работу большое количество мышц одновременно, требуя правильной техники выполнения, а количество повторений при этом может быть минимальным. Движения мягко растягивают мышцы, делая их длиннее и стройнее. Плюс к этому, в работу включаются очень глубокие мышечные группы, о существовании которых вы даже не задумывались и не подозревали, а они играют не последнюю роль в формировании красивой фигуры.<br />\r\n	<br />\r\n	<strong>ХАТ-ХА ЙОГА</strong> - это нечто большее, чем гимнастика.Это молодость и красота.Это раскрытие возможностей , о которых человек и не подозревал. Через дыхание, музыку и расслабление происходит глубокая релаксация и открытие красоты своего тела. Освобождая тело &ndash; освобождаем ум. Делая тело более пластичным, ум тоже становится гибким, что делает жизнь проще. Асаны йоги &ndash; это мягкие растяжки, скручивания и силовые элементы,которые оживляют все мышцы и суставы.<br />\r\n	<br />\r\n	<strong>ПИЛАТЕС ЙОГА</strong> &ndash; это синтез двух направлений &ndash; дополнительно к пилатеса упражнениям для укрепления мышц всего тела в занятия входят позы из йоги, дыхательные практики, упражнения на растяжку и раслабления&nbsp; тела.<br />\r\n	<br />\r\n	<strong>FIT</strong><strong>-</strong><strong>BALL</strong>&nbsp;- тренировка с использованием больших гимнастических мячей. Щадящая нагрузка на позвоночник и суставы. Оригинальная хореография, несложная координация, умеренная нагрузка - для любого уровня подготовки.<br />\r\n	<br />\r\n	<strong>БАЛЕТ </strong>- красивая осанка и движения, это уникальная возможность получать заряд бодрости&nbsp;и сохранять&nbsp;тонус мышц. Многие справляются&nbsp;с неправильной&nbsp;осанкой, болями&nbsp;в поясницеи даже&nbsp;с искривлением&nbsp;позвоночника. Некоторым классика дает раскрепощение&nbsp;на физическом,&nbsp;а, следовательно, и&nbsp;на эмоциональном&nbsp;уровне.</span></p>\r\n','',NULL,0,NULL,'2011-12-21 11:31:49','abc','2012-01-30 12:58:40','abc'),(21,139,2,'Ķermeņa estētika','<p>\r\n	<span style=\"font-family: verdana; font-size: 11px\">Studijā ir kosmētiskais kabinets, kas piedāvā:<br />\r\n	<br />\r\n	Sejas procedūras:&nbsp;</span></p>\r\n<ul style=\"margin-left: 40px\">\r\n	<li>\r\n		<span style=\"font-family: verdana; font-size: 11px\">dziļā tīrī&scaron;ana&nbsp;&nbsp;&nbsp;</span></li>\r\n	<li>\r\n		<span style=\"font-family: verdana; font-size: 11px\">tīrī&scaron;ana ar augļu skābēm&nbsp;</span></li>\r\n	<li>\r\n		<span style=\"font-family: verdana; font-size: 11px\">darsenvalizācija&nbsp;&nbsp;</span></li>\r\n	<li>\r\n		<span style=\"font-family: verdana; font-size: 11px\">mezoprocedūras</span></li>\r\n	<li>\r\n		<span style=\"font-family: verdana; font-size: 11px\">mikrodermobrāzija</span></li>\r\n</ul>\r\n<p>\r\n	<br />\r\n	<span style=\"font-family: verdana; font-size: 11px\">Sejas masāža:</span></p>\r\n<ul style=\"margin-left: 40px\">\r\n	<li>\r\n		<span style=\"font-family: verdana; font-size: 11px\">limfadrenāžas</span></li>\r\n	<li>\r\n		<span style=\"font-family: verdana; font-size: 11px\">klasiskā</span></li>\r\n	<li>\r\n		<span style=\"font-family: verdana; font-size: 11px\">liftinga</span></li>\r\n	<li>\r\n		<span style=\"font-family: verdana; font-size: 11px\">tonizējo&scaron;a</span></li>\r\n	<li>\r\n		<span style=\"font-family: verdana; font-size: 11px\">paraorbitalo/acu/zonu masāža</span></li>\r\n	<li>\r\n		<span style=\"font-family: verdana; font-size: 11px\">vibrācijas</span></li>\r\n	<li>\r\n		<span style=\"font-family: verdana; font-size: 11px\">modelējo&scaron;a</span></li>\r\n</ul>\r\n<p>\r\n	<br />\r\n	<span style=\"font-family: verdana; font-size: 11px\">Sejas maskas:</span></p>\r\n<ul style=\"margin-left: 40px\">\r\n	<li>\r\n		<span style=\"font-family: verdana; font-size: 11px\">mitrino&scaron;a</span></li>\r\n	<li>\r\n		<span style=\"font-family: verdana; font-size: 11px\">barojo&scaron;a</span></li>\r\n	<li>\r\n		<span style=\"font-family: verdana; font-size: 11px\">liftinga</span></li>\r\n</ul>\r\n<p>\r\n	<br />\r\n	<span style=\"font-family: verdana; font-size: 11px\">Sejas procedūras ar AHA skābēm.<br />\r\n	<br />\r\n	Krioprocedūras:</span></p>\r\n<ul style=\"margin-left: 40px\">\r\n	<li>\r\n		<span style=\"font-family: verdana; font-size: 11px\">galvas masāža</span></li>\r\n	<li>\r\n		<span style=\"font-family: verdana; font-size: 11px\">sejas masāža</span></li>\r\n	<li>\r\n		<span style=\"font-family: verdana; font-size: 11px\">kārpu noņem&scaron;ana</span></li>\r\n</ul>\r\n<p>\r\n	<br />\r\n	<span style=\"font-family: verdana; font-size: 11px\">Vaksācija:</span></p>\r\n<ul style=\"margin-left: 40px\">\r\n	<li>\r\n		<span style=\"font-family: verdana; font-size: 11px\">Bikini,kājas,rokas,uzacis,seja</span></li>\r\n</ul>\r\n<p>\r\n	<br />\r\n	<span style=\"font-family: verdana; font-size: 11px\">Uzacu&nbsp; korekcija, uzacu un skropstu krāso&scaron;ana.<br />\r\n	<br />\r\n	Ķermeņa procedūras:</span></p>\r\n<ul style=\"margin-left: 40px\">\r\n	<li>\r\n		<span style=\"font-family: verdana; font-size: 11px\">muskuļu nostiprinā&scaron;ana un svara samazinā&scaron;ana ar aparātu &bdquo;BodyFormer&rdquo;</span></li>\r\n	<li>\r\n		<span style=\"font-family: verdana; font-size: 11px\">presoterapija (zābaki &bdquo;vieglas kājas&rdquo;)</span></li>\r\n	<li>\r\n		<span style=\"font-family: verdana; font-size: 11px\">ķermeņa masāža (mugura,kājas,vēders,rokas)</span></li>\r\n	<li>\r\n		<span style=\"font-family: verdana; font-size: 11px\">anticelulīta masāža</span></li>\r\n	<li>\r\n		<span style=\"font-family: verdana; font-size: 11px\">taizemes pēdu masāža</span></li>\r\n	<li>\r\n		<span style=\"font-family: verdana; font-size: 11px\">mugurkaula izstiep&scaron;ana( ar speciālu trenažieri),vestibulārā aparāta korekcija&nbsp;</span></li>\r\n</ul>\r\n','',NULL,0,NULL,'2011-12-21 11:47:49','abc','2012-01-27 17:33:45','1Bm'),(22,139,1,'Эстетика тела','<p>\r\n	<span style=\"font-family: verdana; font-size: 11px\">В студии работает косметический&nbsp; кабинет:<br />\r\n	<br />\r\n	Процедуры для лица:</span></p>\r\n<ul style=\"margin-left: 40px\">\r\n	<li>\r\n		<span style=\"font-family: verdana; font-size: 11px\">глубокая чистка ( механическая,&nbsp; ультрозвуковая )</span></li>\r\n	<li>\r\n		<span style=\"font-family: verdana; font-size: 11px\">чистка фруктовыми кислотами</span></li>\r\n	<li>\r\n		<span style=\"font-family: verdana; font-size: 11px\">дарсенвализация</span></li>\r\n	<li>\r\n		<span style=\"font-family: verdana; font-size: 11px\">мезопроцедуры</span></li>\r\n	<li>\r\n		<span style=\"font-family: verdana; font-size: 11px\">микродермобразия</span></li>\r\n</ul>\r\n<p>\r\n	<br />\r\n	<span style=\"font-family: verdana; font-size: 11px\">Массаж лица:</span></p>\r\n<ul style=\"margin-left: 40px\">\r\n	<li>\r\n		<span style=\"font-family: verdana; font-size: 11px\">лимфадренаж</span></li>\r\n	<li>\r\n		<span style=\"font-family: verdana; font-size: 11px\">класический</span></li>\r\n	<li>\r\n		<span style=\"font-family: verdana; font-size: 11px\">лифтинг</span></li>\r\n	<li>\r\n		<span style=\"font-family: verdana; font-size: 11px\">тонизирующий</span></li>\r\n	<li>\r\n		<span style=\"font-family: verdana; font-size: 11px\">массаж параорбитальных зон /глаза/</span></li>\r\n	<li>\r\n		<span style=\"font-family: verdana; font-size: 11px\">вибрационный</span></li>\r\n	<li>\r\n		<span style=\"font-family: verdana; font-size: 11px\">моделирующий</span></li>\r\n</ul>\r\n<p>\r\n	<br />\r\n	<span style=\"font-family: verdana; font-size: 11px\">Маски для лица:</span></p>\r\n<ul style=\"margin-left: 40px\">\r\n	<li>\r\n		<span style=\"font-family: verdana; font-size: 11px\">увлажняющая</span></li>\r\n	<li>\r\n		<span style=\"font-family: verdana; font-size: 11px\">питательная</span></li>\r\n	<li>\r\n		<span style=\"font-family: verdana; font-size: 11px\">лифтинговая</span></li>\r\n</ul>\r\n<p>\r\n	<br />\r\n	<span style=\"font-family: verdana; font-size: 11px\">Процедуры для лица с AHA кислотами.<br />\r\n	<br />\r\n	Крио процедуры:</span></p>\r\n<ul style=\"margin-left: 40px\">\r\n	<li>\r\n		<span style=\"font-family: verdana; font-size: 11px\">массаж головы</span></li>\r\n	<li>\r\n		<span style=\"font-family: verdana; font-size: 11px\">массаж лица</span></li>\r\n	<li>\r\n		<span style=\"font-family: verdana; font-size: 11px\">удаление бородавок</span></li>\r\n</ul>\r\n<p>\r\n	<br />\r\n	<span style=\"font-family: verdana; font-size: 11px\">Ваксация:</span></p>\r\n<ul style=\"margin-left: 40px\">\r\n	<li>\r\n		<span style=\"font-family: verdana; font-size: 11px\">бикини, ноги, руки, брови, лицо</span></li>\r\n</ul>\r\n<p>\r\n	<br />\r\n	<span style=\"font-family: verdana; font-size: 11px\">Корекция бровей, покраска бровей и ресниц.<br />\r\n	<br />\r\n	Процедуры для тела:</span></p>\r\n<ul style=\"margin-left: 40px\">\r\n	<li>\r\n		<span style=\"font-family: verdana; font-size: 11px\">укрепление мышц и потеря веса с апаратом &bdquo;Body Former&rdquo;</span></li>\r\n	<li>\r\n		<span style=\"font-family: verdana; font-size: 11px\">прессотерапия (вакуумные сапоги &bdquo;лёгкие ноги&rdquo;)</span></li>\r\n	<li>\r\n		<span style=\"font-family: verdana; font-size: 11px\">массаж&nbsp; тела (спина, ноги, живот, руки)</span></li>\r\n	<li>\r\n		<span style=\"font-family: verdana; font-size: 11px\">антицеллюлитный массаж</span></li>\r\n	<li>\r\n		<span style=\"font-family: verdana; font-size: 11px\">тайский массаж стоп</span></li>\r\n</ul>\r\n<p>\r\n	&nbsp;<